import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './DashboardPage.css';

const DashboardPage = () => {
  const [step, setStep] = useState(1);
  const [selectedBeach, setSelectedBeach] = useState('');
  const [rating, setRating] = useState('');
  const [beaches, setBeaches] = useState([]);
  const [beachInfo, setBeachInfo] = useState({});
  const [visitDate, setVisitDate] = useState('');
  const [comment, setComment] = useState('');

  // Fetch beaches data from server on component mount
  useEffect(() => {
    fetchBeaches();
  }, []);

  const fetchBeaches = async () => {
    try {
      const response = await axios.get('http://localhost:3001/playas');
      setBeaches(response.data);
    } catch (error) {
      console.error('Error fetching beaches:', error);
    }
  };

  const handleNextStep = () => {
    setStep(step + 1);
  };

  const handlePrevStep = () => {
    setStep(step - 1);
  };

  const handleRatingChange = (e) => {
    const value = e.target.value;
    if (value === '' || (Number(value) >= 0 && Number(value) <= 100)) {
      setRating(value);
    }
  };

  const handleDateChange = (e) => {
    setVisitDate(e.target.value);
  };

  const handleCommentChange = (e) => {
    setComment(e.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Add your validation logic here
    console.log('Rating:', rating);
    console.log('Visit Date:', visitDate);
    console.log('Comment:', comment);
  };

  const handleBeachSelect = (beach) => {
    setSelectedBeach(beach.nombre);
    setBeachInfo(beach);
    setStep(2);
  };

  return (
    <div className="dashboard-container">
      <div className="form-container">
        {step === 1 && (
          <>
            <h2>Selecciona una Playa</h2>
            <select
              value={selectedBeach}
              onChange={(e) => handleBeachSelect(beaches.find(beach => beach.nombre === e.target.value))}
            >
              <option value="">Seleccione una playa</option>
              {beaches.map((beach, index) => (
                <option key={index} value={beach.nombre}>
                  {beach.nombre}
                </option>
              ))}
            </select>
            {selectedBeach && (
              <div>
                <p>{beachInfo.ubicacion}</p>
                <img src={require(`../Assets/${beachInfo.img}`).default} alt={beachInfo.nombre} />
                <p>{beachInfo.link}</p>
                <button onClick={handleNextStep}>Siguiente</button>
              </div>
            )}
          </>
        )}

        {step === 2 && (
          <>
            <h2>Califica la Playa</h2>
            <label htmlFor="rating">Calificación</label>
            <input
              type="number"
              id="rating"
              value={rating}
              onChange={handleRatingChange}
              min="0"
              max="100"
            />
            <label htmlFor="visitDate">Fecha de Visita</label>
            <input
              type="date"
              id="visitDate"
              value={visitDate}
              onChange={handleDateChange}
              max={new Date().toISOString().split('T')[0]}
              min="1950-01-01"
            />
            <label htmlFor="comment">Comentario</label>
            <textarea
              id="comment"
              value={comment}
              onChange={handleCommentChange}
            />
            <button onClick={handlePrevStep} className="back-button">Atrás</button>
            <button onClick={handleSubmit}>Aceptar</button>
          </>
        )}
      </div>
    </div>
  );
};

export default DashboardPage;
